import React from 'react';

class List extends React.Component{
  constructor(props){
    super(props);
  }

  render(){
    return(
      <ul>
        {this.props.tasks.map((item,i) => {
          return <li onClick={this.handleClick.bind(this)} key={i}>{item}
          <button className = "oof" onClick={() => this.props.action(i)}>Delete</button>
          </li>
        })}
      </ul>
    )
  }
}

export default List;
